import React from "react";
import logo from './logo.svg';
import './App.css';
import '.index.css';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
      fetch("/").then((res) => res.json()).then((data) => setData(data.message));
    }
  );



  return (
    <div className="App">
      <div class="ring">
          <i style="--clr:#fa65ff;"></i>
          <i style="--clr:#8c63ff;"></i>
          <i style="--clr:#36effc;"></i>

      </div>
    </div>
  );
}

export default App;
